pragma solidity ^0.5.8;

contract Storage {event __CoverageStorage(string fileName, uint256 lineNumber);
event __FunctionCoverageStorage(string fileName, uint256 fnId);
event __StatementCoverageStorage(string fileName, uint256 statementId);
event __BranchCoverageStorage(string fileName, uint256 branchId, uint256 locationIdx);
event __AssertPreCoverageStorage(string fileName, uint256 branchId);
event __AssertPostCoverageStorage(string fileName, uint256 branchId);

    event StoredFile(address owner, uint index);

    struct File {
        address owner;
        string hash;
        uint amount;
        mapping(address => bool) sharedWith;
    }

    File[] private files;

    mapping(address => string[]) hashes;
    mapping(string => address[]) hashShared;
    mapping(address => uint[]) ownFiles;

    modifier canView(uint index) {emit __FunctionCoverageStorage('/home/oxoft/Documents/dapp/contracts/Storage.sol',1);

emit __CoverageStorage('/home/oxoft/Documents/dapp/contracts/Storage.sol',20);
        emit __AssertPreCoverageStorage('/home/oxoft/Documents/dapp/contracts/Storage.sol',1);
emit __StatementCoverageStorage('/home/oxoft/Documents/dapp/contracts/Storage.sol',1);
require(files[index].sharedWith[msg.sender] || files[index].owner == msg.sender, 'You can not see the file');emit __AssertPostCoverageStorage('/home/oxoft/Documents/dapp/contracts/Storage.sol',1);

emit __CoverageStorage('/home/oxoft/Documents/dapp/contracts/Storage.sol',21);
        _;
    }

    function add(string memory hash, uint amount, address[] memory shareWith) public {emit __FunctionCoverageStorage('/home/oxoft/Documents/dapp/contracts/Storage.sol',2);

emit __CoverageStorage('/home/oxoft/Documents/dapp/contracts/Storage.sol',25);
        emit __StatementCoverageStorage('/home/oxoft/Documents/dapp/contracts/Storage.sol',2);
hashShared[hash] = shareWith;
emit __CoverageStorage('/home/oxoft/Documents/dapp/contracts/Storage.sol',26);
        emit __StatementCoverageStorage('/home/oxoft/Documents/dapp/contracts/Storage.sol',3);
uint index = files.push(File(msg.sender, hash, amount)) - 1;
emit __CoverageStorage('/home/oxoft/Documents/dapp/contracts/Storage.sol',27);
        emit __StatementCoverageStorage('/home/oxoft/Documents/dapp/contracts/Storage.sol',4);
for(uint32 i; i < shareWith.length; i++){
emit __CoverageStorage('/home/oxoft/Documents/dapp/contracts/Storage.sol',28);
            emit __StatementCoverageStorage('/home/oxoft/Documents/dapp/contracts/Storage.sol',5);
files[index].sharedWith[shareWith[i]] = true;
        }

emit __CoverageStorage('/home/oxoft/Documents/dapp/contracts/Storage.sol',31);
        emit __StatementCoverageStorage('/home/oxoft/Documents/dapp/contracts/Storage.sol',6);
ownFiles[msg.sender].push(index);
emit __CoverageStorage('/home/oxoft/Documents/dapp/contracts/Storage.sol',32);
        emit __StatementCoverageStorage('/home/oxoft/Documents/dapp/contracts/Storage.sol',7);
hashes[msg.sender].push(hash);
emit __CoverageStorage('/home/oxoft/Documents/dapp/contracts/Storage.sol',33);
        emit __StatementCoverageStorage('/home/oxoft/Documents/dapp/contracts/Storage.sol',8);
emit StoredFile(msg.sender, index);
    }

    function deleteFile(uint index) public canView(index) {emit __FunctionCoverageStorage('/home/oxoft/Documents/dapp/contracts/Storage.sol',3);

emit __CoverageStorage('/home/oxoft/Documents/dapp/contracts/Storage.sol',37);
        delete hashShared[files[index].hash];
emit __CoverageStorage('/home/oxoft/Documents/dapp/contracts/Storage.sol',38);
        delete files[index];
emit __CoverageStorage('/home/oxoft/Documents/dapp/contracts/Storage.sol',39);
        emit __StatementCoverageStorage('/home/oxoft/Documents/dapp/contracts/Storage.sol',9);
hashes[msg.sender] = removeHashes(index, hashes[msg.sender]);
emit __CoverageStorage('/home/oxoft/Documents/dapp/contracts/Storage.sol',40);
        emit __StatementCoverageStorage('/home/oxoft/Documents/dapp/contracts/Storage.sol',10);
ownFiles[msg.sender] = remove(index, ownFiles[msg.sender]);
    }

    function getFile(uint index) public      canView(index) returns(string memory){emit __FunctionCoverageStorage('/home/oxoft/Documents/dapp/contracts/Storage.sol',4);

emit __CoverageStorage('/home/oxoft/Documents/dapp/contracts/Storage.sol',44);
        emit __StatementCoverageStorage('/home/oxoft/Documents/dapp/contracts/Storage.sol',11);
return files[index].hash;
    }

    function getIndexes() public      returns (uint[] memory) {emit __FunctionCoverageStorage('/home/oxoft/Documents/dapp/contracts/Storage.sol',5);

emit __CoverageStorage('/home/oxoft/Documents/dapp/contracts/Storage.sol',48);
        emit __StatementCoverageStorage('/home/oxoft/Documents/dapp/contracts/Storage.sol',12);
return ownFiles[msg.sender];
    }

    function removeHashes(uint index, string[] memory array) private      returns(string[] memory) {emit __FunctionCoverageStorage('/home/oxoft/Documents/dapp/contracts/Storage.sol',6);

emit __CoverageStorage('/home/oxoft/Documents/dapp/contracts/Storage.sol',52);
        emit __StatementCoverageStorage('/home/oxoft/Documents/dapp/contracts/Storage.sol',13);
for (uint i = index; i < array.length - 1; i++) {
emit __CoverageStorage('/home/oxoft/Documents/dapp/contracts/Storage.sol',53);
            emit __StatementCoverageStorage('/home/oxoft/Documents/dapp/contracts/Storage.sol',14);
array[i] = array[i+1];
        }
emit __CoverageStorage('/home/oxoft/Documents/dapp/contracts/Storage.sol',55);
        delete array[array.length-1];
emit __CoverageStorage('/home/oxoft/Documents/dapp/contracts/Storage.sol',56);
        emit __StatementCoverageStorage('/home/oxoft/Documents/dapp/contracts/Storage.sol',15);
return array;
    }

    function remove(uint index, uint[] memory array) private      returns(uint[] memory) {emit __FunctionCoverageStorage('/home/oxoft/Documents/dapp/contracts/Storage.sol',7);

emit __CoverageStorage('/home/oxoft/Documents/dapp/contracts/Storage.sol',60);
        emit __StatementCoverageStorage('/home/oxoft/Documents/dapp/contracts/Storage.sol',16);
for (uint i = index; i < array.length - 1; i++) {
emit __CoverageStorage('/home/oxoft/Documents/dapp/contracts/Storage.sol',61);
            emit __StatementCoverageStorage('/home/oxoft/Documents/dapp/contracts/Storage.sol',17);
array[i] = array[i+1];
        }
emit __CoverageStorage('/home/oxoft/Documents/dapp/contracts/Storage.sol',63);
        delete array[array.length-1];
emit __CoverageStorage('/home/oxoft/Documents/dapp/contracts/Storage.sol',64);
        emit __StatementCoverageStorage('/home/oxoft/Documents/dapp/contracts/Storage.sol',18);
return array;
    }
}
